    def dailyTemperatures_slow(self, temperatures):
        """
        大体思路，有点像用栈实现的最小栈的min[]存储的思路。
        逆向入栈，每进一个数的时候都查询一遍，看查到第几step能找到比自己大的，把step存另一个栈，不过这个栈倒是不用额外维护，这个就是输出列表了，主要是查data的栈。
        如果是反向遍历，注意输出也要处理。

        超出时间限制了，头插也解决不了，可能这个遍历操作太慢，技巧应该在查询
        如果取巧呢？带一个max，如果max不够，直接就给0,解决不了
        """
        output_list = []
        stack = []
        max_val = 0
        for i in range(len(temperatures) - 1, -1, -1):
            # print('x:',temperatures[i])
            j = len(stack) - 1

            cnt = 0
            # print('stack:',stack)
            if temperatures[i] >= max_val:
                cnt = 0
            else:
                while j > -1:
                    # print('stack[j]:',stack[j])
                    cnt += 1
                    if stack[j] > temperatures[i]:
                        break
                    j -= 1
                    if j == -1:
                        cnt = 0
            # print('j:',j)
            # print('len(stack):',len(stack))
            # print('cnt:',cnt)
            output_list.insert(0,cnt)
            max_val = max(max_val,temperatures[i])
            # print('output_list:',output_list)

            stack.append(temperatures[i])
        # print('stack:',stack)
        # print('output:',output_list)

        return output_list
