    # 递减栈
    # 为什么叫递减？为什么最后一个最大？精髓在于入栈？如果我比你大，你肯定就出栈了，你们都出了，我再入。
    # 递减是说，越存在深处不出来的越大，不然逐个都被出栈了。比如[76, 72, 71]遇到75，就变成[76, 75]
    def dailyTemperatures_med(self, temperatures):
        """
        :type temperatures: List[int]
        :rtype: List[int]
        """
        l = []
        stack = []
        print(temperatures)
        for i in range(len(temperatures)):
            l.append(0)#既是默认值初始化，又是l扩容
            # print('length:',len(l))
            if stack and temperatures[i] > stack[-1][0]:
                self.comparison(stack, temperatures[i], i, l)
            stack.append((temperatures[i], i))
        return l

    def comparison(self, stack, nub, index, l):
        print('stack:',stack)
        if stack and nub > stack[-1][0]:
            tup = stack.pop()
            l[tup[1]] = index - tup[1]#按下标存给l
            self.comparison(stack, nub, index, l)#递归，把足够小的都出栈

    # 更快的方法，应该是把递归调用简化了？
    # 注意看，stack存的只是下标，不用数组的，再回去temperatures查就行了
    def dailyTemperatures(self, temperatures):
        """
        :type temperatures: List[int]
        :rtype: List[int]
        """
        stack = list()
        res = [0 for  i in range(len(temperatures))]
        for i in range(len(temperatures)):
            while(len(stack) > 0 and temperatures[i] > temperatures[stack[-1]]):
                res[stack[-1]] = i - stack[-1];
                stack.pop()
            # append等效为stack中的push
            stack.append(i)
        return res




